01136         constexpr inline
01137         const pfx_rat_reg_digs_t & operator ++ ()
01138         noexcept {
01139                 pfx_rat_reg_digs_t& cthis(*this);
01141                 dig_t carry{dig_1()};
01143                 for(std::size_t ix{0} ; ix < LE+LF-1 ; ++ix) {
01144                         if ((m_dc[ix]==dig_Bm1())&&(carry == dig_1())) {
01145                                 m_dc[ix]=dig_0();
01146                                 carry = dig_1();
01147                         }
01148                         else if ((cthis.m_dc[ix]<dig_Bm1())&&(carry == dig_1())){
01149                                 if (carry != dig_0()) {
01150                                         ++m_dc[ix];
01151                                         break;
01152                                 }
01153                         }
01154                 }
01155                 return cthis;
01156         }
