01303                                         m_dc[ix]=dig_0();
01304                                         carry = dig_1();
01305                                 }
01306                                 else if ((m_dc[ix]<dig_Bm1())&&(carry == dig_1())){
01307                                         if (carry != dig_0()) {
01308                                                 ++m_dc[ix];
