01373         std::array<pfx_rat_reg_digs_t,2> mult(dig_t arg) const
01374         noexcept {
01375                 pfx_rat_reg_digs_t cpthis(*this);
01376                 std::array<pfx_rat_reg_digs_t,2> ret{};
01377                 if (arg.is_0()) {
01378                         for (auto& elem : ret[0].m_dc)
01379                                 elem = dig_0();
01380                         for (auto& elem : ret[1].m_dc)
01381                                 elem = dig_0();
01382                         return ret;
01383                 }
01384                 else if (arg.is_1()) {
01385                         ret[0] = cpthis;
01386                         for (auto& elem : ret[1].m_dc)
01387                                 elem = dig_0();
01388                         return ret;
01389                 }
01390                 else {
01391                         dig_t carry{dig_0()};
01392                         for(std::size_t ix{0} ; ix < LE+LF ; ++ix){
01393                                 const auto res = m_dc[ix].mult(arg);
01394                                 const auto uds = res[0].add(carry);
01395                                 ret[0].m_dc[ix] = m_dc[ix] = uds[0] + carry;
01396                                 carry = res[1] + uds[1];
01397                         }
01398                         ret[1].m_dc[0]=carry;
01399                         return ret;
01400                 }
01401         }
