01804                 UINT_T carry_add{0};
01805 
01806                 reg_ints_t<LE+LF> retints{};
01807                 for(std::size_t ix{0} ; ix < LE+LF ; ++ix){
01808                         retints[ix] = ret(ix);
01809                 }
01810 
01811                 reg_ints_t<LE+LF> argints{};
01812                 for(std::size_t ix{0} ; ix < LE+LF ; ++ix){
01814                         argints[ix] = (B-1)-arg(ix);
01815                 }
01818                 for(std::size_t ix{0} ; ix < LE+LF ; ++ix){
01819                                 argints[ix] = argints[ix]+carry_CB;
01820                                 carry_CB = argints[ix]/B;
01821                 }
01823 
01825                 for(std::size_t ix{0} ; ix < LE+LF ; ++ix) {
01826                         retints[ix] += (argints[ix]+carry_add);
01827                         carry_add = retints[ix]/B;
01828                         ret.m_dc[ix] = dig_t(retints[ix]);
01829                 }
01830                 auto pairret = std::make_pair(dig_t(carry_add),ret);
01831                 return pairret;
01832         }
