01834         constexpr inline
01835         std::array<pfx_rat_reg_digs_t,2> operator* (const pfx_rat_reg_digs_t & arg) const
01836         noexcept {
01837                 const pfx_rat_reg_digs_t & cthis{*this};
01839                 reg_ints_t<LE+LF> actints{};
01840                 for(std::size_t ix{0} ; ix < LE+LF ; ++ix){
01841                         actints[ix] = cthis(ix);
01842                 }
01843                 reg_ints_t<LE+LF> argints{};
01844                 for(std::size_t ix{0} ; ix < LE+LF ; ++ix){
01845                         argints[ix] = arg(ix);
01846                 }
01847                 reg_ints_t<2*(LE+LF)> carryints{};
01848                 for(std::size_t iy{0} ; iy < 2*(LE+LF) ; ++iy) {
01849                         carryints[iy]=0;
01850                 }
01851                 std::array<reg_suints_t<2*(LE+LF)>,LE+LF> retints{};
01852                 for(std::size_t ix{0} ; ix < LE+LF ; ++ix) {
01853                         for(std::size_t iy{0} ; iy < 2*(LE+LF) ; ++iy) {
01854                                 retints[ix][iy]   =             0;
01855                         }
01856                 }
01858 
01861                 for(std::size_t ix{0} ; ix < LE+LF ; ++ix) {
01862                         for(std::size_t iy{0} ; ix+iy < 2*(LE+LF) ; ++iy) {
01863                                 retints[ix][ix+iy]      =               (       static_cast<SIG_UINT_T>(actints[ix])    *
01864                                                                                                                                                 static_cast<SIG_UINT_T>(argints[iy])     )+
01865                                                                                                                                                 static_cast<SIG_UINT_T>(carryints[iy]);
01866                                 carryints[iy]                           =       retints[ix][ix+iy]/B;
01867                                 retints[ix][ix+iy]   %=         B;
01868                         }
01869                 }
01872 
01874                 std::array<pfx_rat_reg_digs_t,LE+LF> rets{};
01875                 for(std::size_t iz{0} ; iz < LE+LF ; ++iz) {
01876                                 rets.m_dc[iz] = pfx_rat_reg_digs_t(retints[iz]);
01877                 }
01878                 for(std::size_t iw{1} ; iw < LE+LF ; ++iw) {
01879                                 rets.m_dc[0] += rets.m_dc[iw];
01880                                 // no hace falta que la suma sea de tamano L+1
01881                 }
01884                 std::array<pfx_rat_reg_digs_t,2> retpair{};
01885                 for(std::size_t ix{0} ; ix < 2*LF ; ++ix) {
01886                                 retpair[0].m_dc[ix] = rets[0].m_dc[ix];
01887                 }
01888                 for(std::size_t ix{2*LF} ; ix < 2*(LE+LF) ; ++ix) {
01889                                 retpair[1].m_dc[ix-2*LF] = rets[0].m_dc[ix];
01890                 }
01892                 return retpair;
01893         }
