02174                                         std::size_t Length>
02175                 requires (type_traits::suitable_base<Int_Type,Base>()&&(Length > 0))
02176         std::istream &
02177         operator >> (std::istream & is,pfx_rat_reg_digs_t<Int_Type,Base,Length> & arg) {
02178                 enum estado_e {
02179                         e0ini   , e1r           , e1e           , e1g                   , e1sep         ,
02180                         e1d             , e1i           , e2g           , e2start       , e2dig         ,
02181                         e2dp    , e2end , e2B           , e3dig         , e0fin
02182                 };
02184                 std::string sds;
02186                 using inttype = typename type_traits::sig_UInt_for_UInt_t<Int_Type>;
02187                 using dig_t = dig_t<Int_Type,Base>;
