02190                 std::size_t     indice{0};
02192                 Int_Type                digito{0};
02193                 std::size_t longitud{0};
02194                 inttype                 numero_base_recogido{0};
02196                 pfx_rat_reg_digs_t& numero_ret{arg};
02198                 estado_e est_act = e0ini;
02200                 char c{'\0'};
02202                 is >> sds;
02204                 do {
02205                         c = sds[indice];
02206                         switch(est_act) {
02207                                 case e0ini :
02208                                         {
02209                                                 if (c=='r') {
02210                                                         est_act = e1r;
02211                                                 } else {
02212                                                         est_act = e0ini;
02213                                                 }
02214                                         }
02215                                         break;
02216                                 case e1r :
02217                                         {
02218                                                 {
02219                                                         if (c=='e') {
02220                                                                 est_act = e1e;
02221                                                         }
02222                                                         else {
02223                                                                 est_act = e0ini;
02224                                                         }
02225                                                 }
02226                                         }
02227                                         break;
02228                                 case e1e :
02229                                         {
02230                                                 if (c=='g') {
02231                                                         est_act = e1g;
02232                                                 }
02233                                                 else  {
02234                                                         est_act = e0ini;
02235                                                 }
02236                                         }
02237                                         break;
02238                                 case e1g :
02239                                         {
02240                                                 if (c=='_') {
02241                                                         est_act = e1sep;
02242                                                 }
02243                                                 else  {
02244                                                         est_act = e0ini;
02245                                                 }
02246                                         }
02247                                         break;
02248                                 case e1sep :
02249                                         {
